el-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"TEMPORADA DE MÚSICA POPULAR\nSONIDOS DEL MUNDO\n\nCONCIERTO Nº 1\nENSAMBLE SERENATA\n\nHernán Jara, Flauta traversa / Guillermo Milla, Oboe / Mauricio Valdebenito, Guitarra y Mandolina / Claudio Acevedo, Cuatro, Quenas, Triple / Pablo Seguel, Contrabajo, Bajo acústico y Guitarrón / Gonzalo Ramos, Percusión latina y Canto\n\nArtistas invitados\nCecilia Echenique, Canto / Juan Antonio Sánchez, Guitarra\n\nEnsamble Serenata es una agrupación de música de cámara que tiene su fuente inspiradora en el repertorio folclórico y popular de Latinoamérica. Estos temas tradicionales son desarrollados por músicos de formación clásica, produciéndose así esta popular fusión. De este modo, la flauta traversa, el oboe, la guitarra clásica y el contrabajo, se combinan con el charango, tiple colombiano, cuatro venezolano, guitarrón mexicano, cajón peruano, congas y variados instrumentos de percusión latina.\n\nJunto al gran tesoro de canciones y bailes que nos ha regalado la historia de nuestra América morena, se agregan trabajos de creación inspirados en los ritmos y sonoridades latinoamericanas.\n\n \n\nTEATRO UNIVERSIDAD DE CHILE: Miércoles 8 de MAYO / 20:00 hrs.","styleRuns":[{"startIndex":0,"length":1137,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"},{"startIndex":1137,"length":5,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"},{"startIndex":1142,"length":5,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"h
